package dummy

import (
	"OperatorAutomation/pkg/core/common"
	"OperatorAutomation/pkg/core/service"
	"math/rand"
)

// Do not initialize use provided CreateDummyProvider function
type DummyProvider struct {
	DummyKubernetes DummyKubernetes
}

func CreateDummyProvider() DummyProvider {
	rand.Seed(42)
	return DummyProvider{DummyKubernetes: DummyKubernetes{map[string]DummyKubernetesData{}}}
}

func (es DummyProvider) GetServiceDescription() string {
	return "Dummy service description"
}

func (es DummyProvider) GetServiceImage() string {
	return "data:image/png;base64,"
}

func (es DummyProvider) GetServiceType() string {
	return "DummyService"
}

func (es DummyProvider) GetTemplate(auth common.IKubernetesAuthInformation) *service.IServiceTemplate {
	var st service.IServiceTemplate = service.ServiceTemplate{
		Yaml:              "apiVersion: operator.knative.dev/v1alpha1\nkind: KnativeEventing\nmetadata:\n  name: eventing\nspec: {}\n",
		ImportantSections: []string{"name"},
	}

	return &st
}

func (es DummyProvider) GetServices(auth common.IKubernetesAuthInformation) ([]*service.IService, error) {
	var services []*service.IService
	for id, data := range es.DummyKubernetes.GetServices() {
		var service service.IService = DummyService{
			id:                id,
			status:            data.status,
			yaml:              data.yaml,
			importantSections: (*es.GetTemplate(auth)).GetImportantSections(),
			serviceType:       es.GetServiceType(),
			auth:              auth,
		}
		services = append(services, &service)
	}
	return services, nil
}

func (es DummyProvider) GetService(auth common.IKubernetesAuthInformation, id string) (*service.IService, error) {
	data, err := es.DummyKubernetes.GetService(id)
	if err != nil {
		return nil, err
	}

	var service service.IService = DummyService{
		id:          id,
		status:      data.status,
		yaml:        data.yaml,
		serviceType: es.GetServiceType(),
		auth:        auth,
	}

	return &service, nil
}

func (es DummyProvider) CreateService(auth common.IKubernetesAuthInformation, yaml string) error {
	return es.DummyKubernetes.Create(yaml)
}

func (es DummyProvider) DeleteService(auth common.IKubernetesAuthInformation, id string) error {
	return es.DummyKubernetes.Delete(id)
}
